script: |
  super -f tsv -I q3326.sql | sort > q3326.out

vector: true

inputs:
  - name: q3326.sql
    data: |
      SELECT * FROM tab1 AS cor0 WHERE NOT col1 + 77 + col1 + - col0 BETWEEN - + col1 AND - CAST ( + col2 AS REAL );
  - name: tab1

outputs:
  - name: q3326.out
    data: |
      51	14	96
      85	5	59
      91	47	68
